import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <div className="flex justify-center space-x-2">
      <div>
        <a target= "_" href="/home">Home</a>
      </div>
      <div>
        <Link target= "_" to="/home2">Home2</Link>
      </div>
      <div>
        <a target= "_" href="/about">About</a>
      </div>
      <div>
        <Link target= "_" to="/about2">About2</Link>
      </div>
    </div>
  );
};

export default Header;
